import React from "react";
import styles from '../styels/chats.module.css';

const Chats = () => {
    return (
        <div className={styles.chats}>
            <div className={styles.userChat}>
                <img src="" />
                <div className={styles.userChatInfo}>
                    <span>Jhon</span>
                </div>
            </div>
        </div>

    )
}

export default Chats;
